import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Block image="../img/beers.png" title="All beers" description="" />
      <Block image="../img/new-beer.png" title="New beer" description="" />
      <Block image="../img/random-beer.png" title="" description="" />
    </div>
  );
}

export default App;
